import React from "react";

function Cart({ items }) {
  return (
    <>
      <div className="cart-items">
        <div className="cart-items-header">Cart Items</div>

        <div>
          {items.map((cartitem) => (
            <div key={cartitem.id} className="cart-item-list">
                <img src={cartitem.ima} />
            </div>
          ))}
        </div>

      </div>
    </>
  );
}

export default Cart;
